import Header from './Components/Header';
import Videos from './Components/Videos';
import VisibilitySensor from "react-visibility-sensor";

import './Home.css';


class Home extends Component {
    constructor() {
        super();
        this.state = {
        };
    }

    onChange(isVisible) {
        console.log('Element is now %s', isVisible ? 'visible' : 'hidden');
    }

    render() {
        return (
            <div>
                <div id="blackscreen">
                    <div id="hometext">
                        <VisibilitySensor
                            onChange={this.onChange()}
                        >
                            <p>Pierre Edouard Joubert</p>
                            <p>Realisateur</p>
                        </VisibilitySensor>

                    </div>
                </div>
                <Header />
                <p>Home Page</p>
                <div id="contentbox">
                    <Videos />
                </div>

            </div>
        );
    }
}

export default Home
